import React from "react";
import Details from "./Details";
function Card(props) {
    return (
        <div>
            <h1 className="heading">My Contacts</h1>
            <div className="card">
                <div className="top">
                    <h2 className="name">{props.name}</h2>
                    <img
                        src={props.imgURL}
                        alt="avatar_img" className="circle-img"
                    />
                </div>
                <Detail phone={props.phone} email={props.email} ></Detail>

            </div>
        </div>
    );
}
export default Card;
